- input: "TEXT\x1CC00394957\x1C.TEXT\x1C\x1CF3A\x1CThis amended report is in response
    to FEC letter dated July 22, 2008.  Item 1: None of the contributions are in excess
    of limits.  Robert Thomas Lupo and Robert E Lupo are not the same person but are
    father and son.  Rathborne Partnership amount for $1,294 was a contribtution for
    the Primary 2008 not Special General  and has been corrected on the amended report
    filed.  Item 2: All election cycle to date totals have been corrected and are
    included in this amendment.  Item 3: Best effort procedures are as follows.  The
    Committee includes clear and conspicuous request for the emloyer and occupation
    and that it is required by federal law on each original solicitation.  If the
    information is not included with the contribution, a seperate stand alone request
    in writing is made within ten days of receipt.  This second request includes informs
    the contributor of the federal law requirements and does not solicit another contribution.
    \ The card includes three options, email, fascimile or telephone, to return the
    information to the committee.  If and when the required information is received,
    it is included on the next report filing as a memo."
